import React from "react";
import Footer from "./components/footer/footer";
import Header from "./components/header/header";
import {Outlet} from 'react-router-dom';

class App extends React.Component{
  render(){
    return(
      <div className="divBody">
      <Header></Header>
      <Outlet></Outlet>
      <h1>Hello World</h1>
      <Footer></Footer>
      </div>
    )
  }
}

export default App;
